import React from 'react';
import {Link} from 'react-router-dom';
import {useWindowDimensions} from '../window-hook/window-dimension-hook';
import styles from './header.module.css';

const Header = () => {

    const {width} = useWindowDimensions();

    return (
        <header className={width > 1000 ? styles.header : styles.mobileHeader}>
            <div className={styles.navBox}>
                <Link to='/' className={styles.navLink}>Home</Link>
                <Link to='/cats-page' className={styles.navLink}>Cats</Link>
                <Link to='/dogs-page' className={styles.navLink}>Dogs</Link>
            </div>
        </header>
    )
}

export default Header;
